INSERT INTO `produto` VALUES (17,'SSD 500 GB Kingston NV2, M.2 2280 PCIe, NVMe, Leitura: 3500 MB/s e Gravação: 2100 MB/s ',10,'Características:\r\n\r\n- Marca: Kingston\r\n\r\n- Modelo: SNV2S/500G\r\n\r\n\r\n\r\nEspecificações:\r\n\r\n- Fator de forma: M.2 2280\r\n\r\n- Interface: PCIe 4.0 x4 NVMe\r\n\r\n- Capacidades: 500GB\r\n\r\n- Leitura/Gravação Sequencial: 3.500/2.100 MB/s\r\n\r\n- Resistência (Total de Bytes Gravados): 160 TB\r\n\r\n \r\n\r\nConsumo de energia:\r\n\r\n- 2,3 W Inativo / 2,3 W Médio / 2,2 W (MAX) Leitura / 4,6 W (MAX) Gravação\r\n\r\n \r\n\r\nOperacional:\r\n\r\n- Temperatura de armazenamento: -40°C~85°C\r\n\r\n- Temperatura de operação: 0°C~70°C\r\n\r\n- Dimensões: 22mm x 80mm x 2,2mm\r\n\r\n- Peso: 7g (todas as capacidades)\r\n\r\n- Vibração Operacional: 2,17 G (7-800 Hz)\r\n\r\n- Vibração Não operacional: 20G (20-1000Hz)\r\n\r\n- MTBF: 1.500.000 horas\r\n\r\n \r\n\r\nConteúdo da Embalagem:\r\n\r\n- SSD Kingston NV2 500 GB\r\n\r\n\r\nGarantia:\r\n3 anos de garantia (3 meses de garantia legal + 33 meses de garantia contratual junto ao fabricante)\r\n\r\nPeso:\r\n40 gramas (bruto com embalagem)',295,'Novo',1,10,NULL,NULL,NULL),(20,'SSD SATA WD Green, 480GB, 2.5\", Leitura: 545MB/s e Gravação: 430MB/s, Preto ',10,'Características:\r\n\r\n- Marca: WD Green\r\n\r\n- Modelo: WDS480G3G0A\r\n\r\n \r\n\r\nEspecificações:\r\n\r\n- Seq. Leitura até (MB/s): 545\r\n\r\n\r\n\r\nEnergia:\r\n\r\n- Potência ativa média (mW): 60\r\n\r\n- Máx. Leitura Operacional (mW): 1.700\r\n\r\n- Sono (mW): 26\r\n\r\n- DEVSLP (mW): 10\r\n\r\n \r\n\r\nConfiabilidade:\r\n\r\n- MTTF‡‡: Até 1,0 milhão de horas\r\n\r\n \r\n\r\nAmbiental:\r\n\r\n- Temperaturas de operação‡‡‡: 0°C a 70°C\r\n\r\n- Temperaturas não operacionais: -55°C a 85°C\r\n\r\n- Vibração operacional: 5,0 gRMS, 10-2000 Hz\r\n\r\n- Vibração não operacional: 4,9 gRMS, 7-800 Hz\r\n\r\n- Choque: 1.500 G @ 0,5 ms de meio seno\r\n\r\n- Certificações: FCC, UL, TUV, KC, BSMI, VCCI, CE, Marrocos, RCM, UKCA\r\n\r\n \r\n\r\nDimensões físicas 2,5\"\"/7mm com caixa\":\r\n\r\n- Fator de forma: 2,5\"/7mm\r\n\r\n- Comprimento: 100,5 mm\r\n\r\n- Largura: 69,85 mm\r\n\r\n- Altura: 7,00mm\r\n\r\n- Peso (± 0,5g): 36,2 ± 0,5\r\n\r\n\r\n\r\nConteúdo da Embalagem:\r\n\r\n- SSD WD Green, 480GB\r\n\r\n\r\nGarantia:\r\n3 anos de garantia (3 meses de garantia legal + 33 meses de garantia contratual junto ao fabricante)\r\n\r\nPeso:\r\n66 gramas (bruto com embalagem)',218.99,'Novo',1,10,NULL,NULL,NULL),(21,'TV O led',10,'TV',1299,'Novo',1,10,NULL,NULL,NULL),(22,'Mouse Gamer Redragon Cobra, Chroma RGB, 10000DPI, 7 Botões, Preto ',10,'Mouse Gamer Redragon Cobra M711 V2\r\n \r\n\r\nIluminação RGB trazendo mais brilho para seu setup.\r\n\r\nSistema de peso ajustável com compartimento para instalação na parte debaixo do mouse.\r\n\r\nDescanso para o polegar integrado, deixando o dedo apoiado no mouse sem raspar no mouse pad.\r\n\r\nLaterais texturizadas fornecendo uma pegada mais firme e precisa.\r\n\r\nConector USB banhado a ouro proporcionando uma maior durabilidade e longevidade.',99.9,'Novo',2,10,NULL,NULL,NULL),(23,'Mouse Gamer HyperX Pulsefire Haste RGB, 16000 DPI, BKRD',10,'Mouse Gamer HyperX Pulsefire Haste BKRD, HMSH1-A-RD/G - 4P5E3AA\r\n\r\nPulsefire Haste é fabricado com a estrutura em design de favos de mel que torna o mouse mais leve do que um mouse de estrutura sólida, sem comprometer sua durabilidade. O desenho de malha aberta também permite melhor ventilação e fluxo de ar.\r\n\r\n \r\n\r\nCabo USB HyperFlex\r\nO cabo USB HyperFlex é feito de paracord leve e flexível para reduzir a tensão e a resistência e proporcionar um movimento mais fácil do mouse. Micro switches TTC Golden resistentes à poeira\r\nEssas teclas proporcionam cliques sólidos e eficientes, assim, você saberá que foram registrados. Eles também possuem um revestimento antipoeira e estão classificados para até 60 milhões de cliques.\r\n\r\nSkates de puro PTFE\r\nOs skates 100% PTFE de baixa fricção ajudam a fornecer um deslizamento suave para tornar o mouse mais ágil. Também está incluído um conjunto de substituição dos skates no caso de ficarem gastos.\r\nPara pessoas que preferem um pouco mais de controle e conforto, há uma a fita de fixação incluída para as laterais do mouse e para ambos os botões do mouse, esquerdo e direito.\r\n\r\n\r\nPersonalizável com o software HyperX NGENUITY\r\nConfigurações DPI, iluminação RGB, atribuição dos botões e a gravação de macros são facilmente personalizáveis e fáceis de usar com o software HyperX NGENUITY.\r\nO Pixart 3335 é um excelente equilíbrio entre peso e desempenho e pode detectar até 16000 DPI nativo. Obtenha o rastreamento fluido e ágil de que você precisa para manter seu objetivo no alvo.',199.9,'Novo',2,10,NULL,NULL,NULL),(24,'Test',10,'PROD',299,'Novo',1,10,'TEC',1,199);
